export default function png_quant(dataurl, quality_min, quality_max, speed, pool) {

    dataurl = dataurl || "";
    quality_min = quality_min | 0;
    quality_max = quality_max | 0;
    speed = speed | 0;
    pool = pool || null;

    const options = {"speed": speed.toString(), "quality": quality_min.toString() + "-" + quality_max.toString(), "nofs": true, "floyd": 0, "strip": true};

    return new Promise(function(resolve, reject){

        if(Boolean(pool)) {

            pool.exec(window.png_quant_process_function, [
                dataurl, options
            ]).catch((e) => {

                return window.png_quant_process_function(dataurl, options);
            }).then(function(r){

                return new Promise(function(resolve, reject){

                    if(r.match("data:image/png;base64,dW5kZWZpbmVk")){

                        resolve(dataurl);
                    }else {

                        resolve(r);
                    }
                });
            }).then(function(r){resolve(r)}).catch(function(e){reject(e)}).timeout(60 * 1000);
        }else {


            window.png_quant_process_function(dataurl, options).then(function(r){resolve(r)}).catch(function(e){reject(e)});
        }
    });
};